import React from 'react';
import { MembersTitle } from '../MemberstableList/components/MembersTitle';
import { MembersListContent } from '../MemberstableList/components/MembersListContent';
export const MemberstableList = () => {
	return (
		<div className='TableList'>
			<div className='TableList__button'>
				<MembersTitle />
			</div>
			<div className='TableList__content'>
				<MembersListContent />
			</div>
		</div>
	);
};
